import React, { Component } from "react";
import { FaHome } from "react-icons/fa";
import logo from "../../images/logo.jpg"

export default class Nav extends Component {
    render() {
        return (
            <div className="nav">
                <div className="nav__blocks">
                    <FaHome />
                </div>
                <div className="nav__blocks"></div>
                <div className="nav__Blocks"></div>
            </div>
        )
    }
}
